import { h } from "@stencil/core";
export class CardContent {
    componentDidLoad() {
        this.cardContentEl.style.setProperty('padding', '16px 16px 16px 16px');
    }
    render() {
        return (h("section", { ref: el => this.cardContentEl = el },
            h("slot", null)));
    }
    static get is() { return "materials-card-content"; }
}
